import Navbar from "./component/Navbar";
import Home from "./pages/Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
    <div className="flex flex-row bg-bgColor mr-5">
      <Navbar/>
      <Routes>

        <Route path="/" element={<Home />} />


      </Routes>
    </div>
  </Router>
  );
}

export default App;
